import React, { useState } from 'react';
import '../styles/UserManager.css';

function UserManager() {
  const [userInput, setUserInput] = useState('');

  const handleAddUser = () => {
    console.log('User added:', userInput);
    setUserInput('');
  };

  const handleDeleteAllUsers = () => {
    if (window.confirm('Are you sure you want to delete all users?')) {
      console.log('All users deleted');
    }
  };

  return (
    <div className="user-manager">
      <input
        type="text"
        value={userInput}
        onChange={(e) => setUserInput(e.target.value)}
        placeholder="Enter username or chat ID"
      />
      <button className="add-button" onClick={handleAddUser}>Add User/Chat</button>
      <button className="delete-button" onClick={handleDeleteAllUsers}>Delete All Users</button>
    </div>
  );
}

export default UserManager;
